paramConversion.applyStepsToNormalizedParameterValue:
function applyStepsToNormalizedParameterValue(normalizedValue, steps) {
    if (steps == 1) {
        if (normalizedValue > 0) {
            normalizedValue = 1.;
        }
    } else {
        let oneStep = 1. / (steps - 1);
        let numberOfSteps = rnbo_fround(normalizedValue / oneStep * 1 / 1) * 1;
        normalizedValue = numberOfSteps * oneStep;
    }

    return normalizedValue;
}

paramConversion.convertToNormalizedParameterValue:
function convertToNormalizedParameterValue(index, value) {
    switch (index) {
    case 4:
        {
            value = (value < 0 ? 0 : (value > 32 ? 32 : value));
            let normalizedValue = (value - 0) / (32 - 0);
            return normalizedValue;
        }
    case 2:
        {
            value = (value < 1 ? 1 : (value > 16 ? 16 : value));
            let normalizedValue = (value - 1) / (16 - 1);
            return normalizedValue;
        }
    case 1:
    case 3:
        {
            value = (value < 1 ? 1 : (value > 127 ? 127 : value));
            let normalizedValue = (value - 1) / (127 - 1);
            return normalizedValue;
        }
    case 0:
        {
            value = (value < 2 ? 2 : (value > 32 ? 32 : value));
            let normalizedValue = (value - 2) / (32 - 2);
            return normalizedValue;
        }
    default:
        return value;
    }
}

paramConversion.convertFromNormalizedParameterValue:
function convertFromNormalizedParameterValue(index, value) {
    value = (value < 0 ? 0 : (value > 1 ? 1 : value));

    switch (index) {
    case 4:
        {
            {
                return 0 + value * (32 - 0);
            }
        }
    case 2:
        {
            {
                return 1 + value * (16 - 1);
            }
        }
    case 1:
    case 3:
        {
            {
                return 1 + value * (127 - 1);
            }
        }
    case 0:
        {
            {
                return 2 + value * (32 - 2);
            }
        }
    default:
        return value;
    }
}

paramConversion.constrainParameterValue:
function constrainParameterValue(index, value) {
    var v = value;

    switch (index) {
    case 0:
        {
            v = (v > 32 ? 32 : (v < 2 ? 2 : v));
            return v;
        }
    case 1:
        {
            v = (v > 127 ? 127 : (v < 1 ? 1 : v));
            return v;
        }
    case 2:
        {
            v = (v > 16 ? 16 : (v < 1 ? 1 : v));
            return v;
        }
    case 3:
        {
            v = (v > 127 ? 127 : (v < 1 ? 1 : v));
            return v;
        }
    case 4:
        {
            v = (v > 32 ? 32 : (v < 0 ? 0 : v));
            return v;
        }
    default:
        return value;
    }
}
